import React, { useState } from "react";

import Header from "../../components/Header";

const Homepage = () => {
  const [toggle, setToggle] = useState(false);
  const onToggleMenu = () => {
    setToggle(!toggle);
  };

  return (
    <>
      <Header onToggleMenu={onToggleMenu} />
      <div className="ui container">Homepage</div>
    </>
  );
};

export default Homepage;
